IF OBJECT_ID('dbo.proc_transform_404', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_404;
GO
CREATE PROCEDURE dbo.proc_transform_404
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_404
    SET payload = LEFT(payload, 1000) + N'|V4-404|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_404;
END
